//   |H(f)| = |--- * --------------- |  * |--- * --------------- |
//            | R1     sin(PI*f/fs)  |    | R2    sin(PI*f/fs)   |
//     Where fs = modulator frequency i.e. MCLK/ 8 in low power
//            f = frequency of interest i.e. nth harmonic here
